定番のサテン生地です。<br>
色数が豊富で、資材から衣料、裏地などあらゆる用途にお使いいただけます。<br><br>

★表示価格は10cm単位（税込）です。<br>
50cm以上10cm単位でご注文ください。<br>
・入力例：60cm　→　6 、120cm　→　12<br><br>

◆幅：約90cm<br>
◆素材：ポリエステル100％<br><br>

※お客様のご注文数によりカットされた生地は再販売不能となりますので、不良品、商品違い以外のお客様都合での返品はお受けできません。あらかじめご了承の上、ご注文ください。<br>
※モニターによって実物のお色と若干異なる場合がございます。

